938609570734c6859b5d1ae0a4601644:
query IssueSubIssues_NestedQuery(
  $id: ID!
) {
  node(id: $id) {
    __typename
    ... on Issue {
      id
      subIssues(first: 50) {
        nodes {
          ...IssueSubIssues_InnerFragment
          id
        }
      }
    }
    id
  }
}

fragment IssueSubIssues_InnerFragment on Issue {
  id
  title
  titleHTML
  state
  url
  labels(first: 10) {
    nodes {
      id
      name
      color
    }
  }
  assignees(first: 10) {
    totalCount
    edges {
      node {
        id
        login
        avatarUrl
      }
    }
  }
  subIssuesSummary {
    total
    completed
    percentCompleted
  }
  closedByPullRequestsReferences(first: 0, includeClosedPrs: true) {
    totalCount
  }
}

